import React from 'react'
import Tab from './Tab'
const Container = (props) => {
  const containerStyle = {
    display: 'flex',
    justifyContent: 'space-evently',
    flexWrap: 'wrap',
    margin: '2rem',
    height: '40vh',
  }
  const tabs = props.tabs
  return (
    <div style={containerStyle}>
      {tabs.map((tab, i) => (
        <Tab key={i} idx={i + 1} />
      ))}
    </div>
  )
}

export default Container
